import React from "react";
import ReactDOM from "react-dom";
import "./Square.css";

class Square extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return <div>{this.props.squareNum}</div>;
  }
}
export class Board extends React.Component {
  render() {
    return <Square squareNum={1} />;
  }
}
